import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";

export default function About() {
  return (
    <div style={styles.container}>
    <Header />
      <h1>About Us</h1>
      <p>
        Welcome to our application! We are dedicated to providing the best experience for our users. 
        Our mission is to create a platform that is not only user-friendly but also highly functional.
      </p>
      <h2>Our Story</h2>
      <p>
        Our journey began in 2020 with the goal of simplifying everyday tasks. 
        Since then, we have grown into a passionate team committed to continuous improvement and innovation.
      </p>
      <h2>Our Values</h2>
      <ul>
        <li>Integrity</li>
        <li>Innovation</li>
        <li>Customer Satisfaction</li>
        <li>Community Engagement</li>
      </ul>
      <Footer />
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    maxWidth: '800px',
    margin: 'auto',
    fontFamily: 'Arial, sans-serif',
  },
};
